Dead Man Running (2009)  

Verenigd Koninkrijk
Actie / Misdaad
120 minuten

geregisseerd door Alex De Rakoff
met Tamer Hassan, Danny Dyer en 50 Cent

De leider van een bende uit de onderwereld geeft Nick vierentwintig uur de tijd om hem het grote geldbedrag terug te betalen wat hij hem schuldig is. Nick zal er alles voor moeten doen om het geld bij elkaar zien te krijgen. Hij vraagt zijn beste vriend om hulp, voordat het te laat is...

